INSERT INTO question_info (id, topic_id, question, image_url, type, create_time) VALUES (215, 12, '除去看见的世界外，我的心中没有另外的世界', '', 1, '2024-07-16 12:41:50');
INSERT INTO question_info (id, topic_id, question, image_url, type, create_time) VALUES (216, 12, '我会想到若干年后有什么使自己极为不安的事', '', 1, '2024-07-16 12:42:41');
INSERT INTO question_info (id, topic_id, question, image_url, type, create_time) VALUES (217, 12, '我常常觉得自己的家庭对自己不好，但是我又确切地知道他们的确对我好', '', 1, '2024-07-16 12:43:26');
INSERT INTO question_info (id, topic_id, question, image_url, type, create_time) VALUES (218, 12, '每天我一回家就立刻把门关上', '', 1, '2024-07-16 12:44:15');
INSERT INTO question_info (id, topic_id, question, image_url, type, create_time) VALUES (219, 12, '我坐在小房间里把门关上，但我仍觉得心里不安', '', 1, '2024-07-16 12:44:55');
INSERT INTO question_info (id, topic_id, question, image_url, type, create_time) VALUES (220, 12, '当一件事需要我作决定时，我常觉得很难', '', 1, '2024-07-16 12:45:28');
INSERT INTO question_info (id, topic_id, question, image_url, type, create_time) VALUES (221, 12, '我常常用抛硬币、翻纸、抽签之类的游戏来预测凶吉', '', 1, '2024-07-16 12:46:06');
INSERT INTO question_info (id, topic_id, question, image_url, type, create_time) VALUES (222, 12, '为了工作我早出晚归，早晨起床我常常感到疲惫不堪', '', 1, '2024-07-16 12:46:52');
INSERT INTO question_info (id, topic_id, question, image_url, type, create_time) VALUES (223, 12, '在某种心境下,我会因为困惑陷入空想,将工作搁置下来', '', 1, '2024-07-16 12:47:15');
INSERT INTO question_info (id, topic_id, question, image_url, type, create_time) VALUES (224, 12, '我的神经脆弱,稍有刺激就会使我战栗', '', 1, '2024-07-16 12:47:36');
INSERT INTO question_info (id, topic_id, question, image_url, type, create_time) VALUES (225, 12, '睡梦中,我常常被噩梦惊醒', '', 1, '2024-07-16 12:47:57');
INSERT INTO question_info (id, topic_id, question, image_url, type, create_time) VALUES (226, 12, '工作中我愿意挑战艰巨的任务', '', 1, '2024-07-16 12:48:54');
INSERT INTO question_info (id, topic_id, question, image_url, type, create_time) VALUES (227, 12, '我常发现别人好的意愿', '', 1, '2024-07-16 12:49:36');
INSERT INTO question_info (id, topic_id, question, image_url, type, create_time) VALUES (228, 12, '能听取不同的意见，包括对自己的批评', '', 1, '2024-07-16 12:50:19');
INSERT INTO question_info (id, topic_id, question, image_url, type, create_time) VALUES (229, 12, '我时常勉励自己，对未来充满希望', '', 1, '2024-07-16 12:51:00');
