INSERT INTO check_score (id, topic_id, min_score, max_score, title, context, note, create_time) VALUES (13, 2, 21, 100, '你最六', '崇拜你', '', '2024-07-02 21:33:21');
INSERT INTO check_score (id, topic_id, min_score, max_score, title, context, note, create_time) VALUES (14, 3, 0, 10, '优秀', '向大佬低头', '', '2024-07-02 23:24:36');
INSERT INTO check_score (id, topic_id, min_score, max_score, title, context, note, create_time) VALUES (15, 3, 11, 50, '自愧不如', '太厉害了', '', '2024-07-02 23:24:36');
INSERT INTO check_score (id, topic_id, min_score, max_score, title, context, note, create_time) VALUES (16, 8, 0, 85, '初级阶段', '无知者无畏的一个阶段，靠着一腔热血来股市赚钱，但是自身却是什么都不太懂，每次交易全凭感觉，可能会由于偶尔大赚几次，但是一段时间下来本金还是迅速缩水，这时候你会觉得不甘心目标从最开始的想赚钱到最后的想回本。', '', '2024-07-03 23:22:07');
INSERT INTO check_score (id, topic_id, min_score, max_score, title, context, note, create_time) VALUES (17, 8, 86, 110, '学习阶段', '例如各种K线组合，MACD均线理论，财务指标，公司运营状态等。很多人就是在这个阶段摸索了很久，经过一段时间的学习下来，发现这些通过技术指标偶尔能赚钱，但更多的时候还是亏损，于是就有很多人在这个阶段。放弃了，认为股市就是一个骗局', '', '2024-07-03 23:22:07');
INSERT INTO check_score (id, topic_id, min_score, max_score, title, context, note, create_time) VALUES (18, 8, 111, 310, '感悟阶段', '对交易的执着已经进入痴迷状态，膜拜大神并且钻研他们的心法语录，产生心理依赖，开始用学习来的战法交易，这些战法确实能够让你在某一段行情里盈利，翻倍的疯狂，腰斩的失落，经历黑暗更像风暴中的一叶孤舟，诅咒之下，欢乐何在，你正在经历炒股最难熬的阶段，辗转反复，不得其法。坚持吧！交易唯有自渡。', '', '2024-07-03 23:22:07');
INSERT INTO check_score (id, topic_id, min_score, max_score, title, context, note, create_time) VALUES (22, 8, 311, 319, '渐悟阶段', '你已经意识到空仓等待行情的重要性，历经劫难后，你终于有了属于自己交易系统，你心如止水，一切人性引起的交易情绪正在淡化，很多时候你再看你自己在交易，这也是悟道的开始阶段。在这个阶段，你的账户曲线逐渐变为大赚小亏，稳步上升，一两次偶尔的回撤。', '', '2024-07-10 14:12:07');
INSERT INTO check_score (id, topic_id, min_score, max_score, title, context, note, create_time) VALUES (23, 8, 320, 400, '顿悟阶段', '到了这个阶段，市场波动已经完全影响不到你，交易变的不在那么重要，看任何事物很通透，不再盲目，掌握市场之心，怡然自得，产生交易俯视感，神降临。', '', '2024-07-10 14:12:07');
INSERT INTO check_score (id, topic_id, min_score, max_score, title, context, note, create_time) VALUES (24, 12, 0, 89, 'EQ较低', '你的EQ较低，你常常不能控制自己，极易被自己的情绪所影响。', '很多时候，你容易被击怒、动火、发脾气，这是非常危险的信号──你的事业可能会毁于你的急躁,对于此,最好的解决办法是能够给不好的东西一个好的解释,保持头脑冷静,使自己心情开朗,正如富兰克林所说:“任何人生气都是有理的,但很少有令人信服的理由。”', '2024-07-16 11:46:38');
INSERT INTO check_score (id, topic_id, min_score, max_score, title, context, note, create_time) VALUES (25, 12, 90, 129, 'EQ居中', '你的EQ一般，不同时候你的表现不一，有时会被情绪所影响。', '对于一件事，你不同时候的表现可能不一，这与你的意识有关，你比前者更具有EQ意识，但这种意识不是常常都有，因此需要你多加注意、时时提醒。', '2024-07-16 11:46:38');
INSERT INTO check_score (id, topic_id, min_score, max_score, title, context, note, create_time) VALUES (26, 12, 130, 149, 'EQ较高', '你的EQ较高，你常常能控制自己，不易被情绪影响。', '你是一个快乐的人，不易恐惧担忧，对于工作你热情投入、敢于负责，你为人更是正义正直、同情关怀，这是你的优点，应该努力保持。', '2024-07-16 11:46:38');
INSERT INTO check_score (id, topic_id, min_score, max_score, title, context, note, create_time) VALUES (27, 12, 150, 175, 'EQ爆表', '你就是个EQ高手，你不仅能控制自己，还能影响他人。', '你就是个EQ高手，你的情绪智慧不但是你事业的阻碍，更是你事业有成的一个重要前提条件，继续保持吧。', '2024-07-16 11:46:38');
